var body = input[0].text;

var buffy = "";

for (var i = 0; i < body.length; i++ ) {
    ch = body.charAt(i);  // get char 
    
    buffy = buffy + charactermap(body.charCodeAt(i));
    

}
next.text = buffy;

function charactermap(ch)
{
 if (ch == '\x91' || ch == '\x92')
 	return '\x27';
 else if (ch == '\x95' || ch == '\x95')
 	return '\x2D';
else if (ch == '\x93' || ch == '\x94')
 	return '\x22';
else if (ch == '\B0' || ch == '\BA')
 	return '\x64';
else if (ch == '\x85')
 	return '\x5F';
else if (ch == '\xB2')
 	return '\x32';
else if (ch == '\xB3')
 	return '\x33';
else if (ch == '\xBD')
 	return '\x2B';
else if (ch == '\xA0')
 	return '\x20';
 else
 	return ch;
}
